create table havenbags
(
    Id             int auto_increment
        primary key,
    HavenBagId     int     not null,
    OwnerId        int     not null,
    ThemeId        tinyint not null,
    MaxRoom        tinyint not null,
    RoomId         tinyint not null,
    FriendsAllowed tinyint not null,
    GuildAllowed   tinyint not null
)
    engine = MyISAM
    charset = utf8;

create index HavenBagId
    on havenbags (HavenBagId);

